import Controler from "../modelAndControler";
let controler=new Controler();
import Component from "../baseComponent";


import PrijavaOkvir from "./prijavaOkvir";


class prijavaListener extends Component {
    constructor() {
        super("div");

        this.addChild(new PrijavaOkvir().rootElement)
        
    controler.addEventListener("currentUser",
    (event) => {
    this.currentUser(); //nova se osoba prijavila/registrirala
}) 
}

currentUser(){
        
        document.getElementById("example1").innerHTML="hello"
    }
}

module.exports = prijavaListener;
